description:
With My Orange you can check your account balance, add options and services, manage Favourite Numbers, recharge online any Orange account with a bank card and change your tariff plan on the go, wherever you are - with just one click.

There's more to come. We've got a load of extra features planned for My Orange over the coming months, so watch out for updates.

What you need to know:
· the app is available for all Orange Abonament, PrePay and Internet Acum PrePay customers;
· you need a 3G/4G internet connection to successfully authenticate in My Orange;
· once authenticated, you can use any data connection, including Wi-Fi;
· the authentication session is valid 14 days and it will automatically reset for another 14 days every time you open the app using an Orange 3G/4G connection;
· the traffic used to download the app will be charged at your standard rate;
· the traffic used within the app is free, except “Orange Stores” and “Orange Chat” sections;
· when using My Orange in roaming, data traffic will be charged according to your roaming rates and options.

More details on https://www.orange.md/?l=1&p=1&c=11&sc=1111

MyMoldcell
Now it is even easier to manage your account! MyMoldcell application offers you the possibility to:
a)      check the account balance, current tariff plan, active options, services and service packs;
b)      see the volume of the used services and frequency of refills;
c)      see the account statement;
d)      refill any Moldcell number via a bank card;
e)      change your current tariff plan;
f)       activate additional options and packs;
g)      activate and deactivate services;
h)      find answers to the most frequently asked questions;
i)       learn the latest Moldcell news and offers;
j)       get in touch with a Customer Care Service operator.

How to use MyMoldcell application:
1.       Download the application and install it on your smartphone.
2.      Register on the start page, indicating the Moldcell phone number and access password, which will be provided to you via SMS.

Note:
-       MyMoldcell application is available for Cartelă, Abonament and Internet ca lumea Moldcell subscribers.
-       The application is offered for free. The subscriber will be charged only for the Internet traffic used while downloading the application, accessing external links or using the application in Roaming.

Learn more on www.moldcell.md

"My StarNet” – aplicație mobilă oferită de principalul furnizor de telecomunicații din Republica Moldova. 

Cele mai bune oferte sunt întotdeauna la StarNet, iar acum le găsești online, în aplicația „My StarNet”.


Internet, Televiziune, Telefonie fixă sau Vision – toate disponibile oriunde te-ai afla, sunt suficiente motive pentru a fi client StarNet!

Totul la un click distanță!


Aplicația „My StarNet” îți permite:
- să verifici și actualizezi detaliile contului tău StarNet;
- să vizualizezi beneficiile și opțiunile disponibile în contul tău;
- să-ți gestionezi serviciile active în cont;
- să-ți modifici opțiunile; 
- să verifici câte Stele de Fidelitate ai acumulat și valoarea lor online;
- să intri rapid în contact cu noi – 24/7;
- să beneficiezi de suport tehnic și asistență dedicată – 24/7;
- să afli categoria ta de client și să beneficiezi de ofertele personalizate direct din cabinetul tău personal.


Descarcă acum și începe să explorezi!
